CREATE TABLE `sys_user` (
  `id` varchar(32) NOT NULL COMMENT 'uuid主键',
  `icon` text COMMENT '头像',
  `name` varchar(32) NOT NULL COMMENT '用户名',
  `real_name` varchar(32) NOT NULL COMMENT '真实名',
  `sex` varchar(1) DEFAULT '1' COMMENT '性别',
  `birth_date` date DEFAULT NULL COMMENT '生日',
  `reg_time` datetime DEFAULT NULL COMMENT '注册时间',
  `mobile_phone` varchar(32) DEFAULT NULL COMMENT '手机号码',
  `email` varchar(50) DEFAULT NULL COMMENT '邮箱',
  `wechat_openid` varchar(50) DEFAULT NULL COMMENT '微信openId',
  `org_code` int(11) NOT NULL COMMENT '部门',
  `org_privilege` int(11) DEFAULT NULL COMMENT '部门权限',
  `role_list` varchar(200) DEFAULT NULL COMMENT '角色序列',
  `locked` tinyint(1) NOT NULL DEFAULT '0' COMMENT '被锁定',
  `state` tinyint(1) NOT NULL DEFAULT '1' COMMENT '激活',
  `id_type` int(11) NOT NULL DEFAULT '1' COMMENT '证件类型',
  `id_number` varchar(45) NOT NULL COMMENT '证件号码',
  `expired_time` date DEFAULT NULL COMMENT '账号过期时间',
  `password_expired_time` date DEFAULT NULL COMMENT '密码过期时间',
  `password` varchar(32) NOT NULL DEFAULT '123456' COMMENT '密码',
  `password_error_times` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  UNIQUE KEY `name` (`name`),
  UNIQUE KEY `ui_sys_user01` (`id_type`,`id_number`),
  UNIQUE KEY `mobile_phone` (`mobile_phone`),
  UNIQUE KEY `email` (`email`),
  UNIQUE KEY `wechat_openid` (`wechat_openid`),
  KEY `index_sys_user_org_code` (`org_code`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='用户|Login user';
